import React from 'react';

const TopNavBar = () => {
  return (
    <header className="w-full flex items-center justify-between bg-white shadow px-6 py-3">
            <div className="w-full flex items-center mt-8">
        <span className="text-2xl font-semibold text-blue-700 border-b-2 border-blue-700 ml-8">My Library</span>
      </div>
      <div className="flex items-center gap-4">
        <button className="text-gray-500 hover:text-blue-700" aria-label="Notifications">
          <span className="material-icons">notifications</span>
        </button>
        <div className="w-8 h-8 rounded-full bg-gray-300 flex items-center justify-center">
          {/* Placeholder for user avatar */}
          <span className="material-icons text-gray-600">person</span>
        </div>
      </div>
    </header>
  );
};

export default TopNavBar;
